// React
import React, { Fragment } from "react";

import { Row, Col, Card, Typography } from "antd";

const OrderedList = ({ data }) => {
  return (
    <Fragment>
      <Row>
        {data.map(data => (
          <Col span={5} offset={1} className="w-50">
            <Card
              title={data.table}
              cover={
                <div className="container">
                  <Typography>{data.cutomer}</Typography>
                </div>
              }
            ></Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default OrderedList;
